/* tslint:disable:no-unused-variable */

import { async, ComponentFixture, TestBed } from '@angular/core/testing';
import { CesiumComponent } from './cesium.component';
import { HelperService } from '../helper.service';
import { Observable } from 'rxjs';
import { AppModule } from '../app.module';
import { HelperServiceMock } from '../../test';
import createSpy = jasmine.createSpy;

declare var Cesium;

describe('CesiumComponent', () => {
  let component: CesiumComponent;
  let fixture: ComponentFixture<CesiumComponent>;
  let helperService: HelperService;
  let fakeDataSource = {};
  beforeEach(async(() => {

    TestBed.configureTestingModule({
      imports: [AppModule],
      providers: [{ provide: HelperService, useClass: HelperServiceMock }]
    })
      .compileComponents();

    helperService = TestBed.get(HelperService);

    Cesium.GeoJsonDataSource.load('base/src/assets/Test/GEOJSON/polygons.geojson').then((ds) => {
      fakeDataSource = ds;
    });

  }));

  beforeEach(() => {
    fixture = TestBed.createComponent(CesiumComponent);
    component = fixture.componentInstance;
    helperService.CESIUM_BASE_URL = '/base/node_modules/cesium/Build/Cesium';
    fixture.detectChanges();
    // component.ngOnInit();
  });

  it('should create', () => {
    expect(component).toBeTruthy();
  });

  it('onClickRasterItem should call the right function via the item type', () => {
    spyOn(component, 'onClickWmsItem');
    spyOn(component, 'onClickTmsItem');

    let $event = {
      item: {
        type: 'wms'
      }
    };

    component.onClickRasterItem($event);
    expect(component.onClickWmsItem).toHaveBeenCalledWith($event);

    $event.item.type = 'tms';

    component.onClickRasterItem($event);
    expect(component.onClickTmsItem).toHaveBeenCalledWith($event);

  });


  it(`flyToLayer() should call viewer flyTo function with the input layer:`, () => {
    spyOn(component.viewer, 'flyTo');
    let layer = fakeDataSource;
    component.flyToLayer({ layer: layer });
    expect(component.viewer.flyTo).toHaveBeenCalledWith(layer);
  });

  it(`onClickTmsItem() should
         1. create layer of tms
         2. layer should be "added to"/"removed from"  the "imagery Layer Collection"(imageryLayers)
         3. to call flyToLayer function`, () => {

    spyOn(component, 'flyToLayer');

    let $event: { item: any, notFly?: boolean } =
      {
        item: {
          url: 'base/src/assets/Test/TMS/ElRefugio_NUEVASec2_2agosto16_Comp',
          type: 'tms',
          checked: true
        },
        notFly: true
      };

    expect($event.item.layer).toBeUndefined();

    // create tms with no flyTo!
    component.onClickTmsItem($event);
    expect($event.item.layer).toBeDefined();
    expect(component.flyToLayer).not.toHaveBeenCalledWith({ layer: $event.item.layer });
    expect(component.viewer.scene.imageryLayers.indexOf($event.item.layer)).not.toEqual(-1);

    //remove tms (tile map service) from map!
    $event.item.checked = false;
    component.onClickTmsItem($event);
    expect(component.viewer.scene.imageryLayers.indexOf($event.item.layer)).toEqual(-1);

    $event.item.checked = true;
    $event.notFly = false;

    //create tms (tile map service) on map with flyTo!
    component.onClickTmsItem($event);
    expect($event.item.layer).toBeDefined();
    expect(component.flyToLayer).toHaveBeenCalledWith({ layer: $event.item.layer });
    expect(component.viewer.scene.imageryLayers.indexOf($event.item.layer)).not.toEqual(-1);

  });

  it(`
  onClickVectorItem() should:
    1) call helperService.getSplitGeojsonData
    2) add this dataSource to viewer.dataSources (Data Sources Collection)
    3) add the points to primitives`, async(() => {

    spyOn(component, 'addPrimitivePointsFromSource');
    spyOn(component, 'addDataSourceFromSource').and.returnValue(Observable.create(obs => obs.next()));
    spyOn(component.viewer.dataSources, 'remove');
    spyOn(component.viewer.scene.primitives, 'remove');

    helperService.getSplitGeojsonData = createSpy('getSplitGeojsonData() spy').and.callFake(() => {
      return Observable.of({
        only_points: only_points,
        without_points: without_points
      });
    });
    let $event: { item: any } =
      {
        item: {
          url: 'url_to_geojson',
          checked: true
        }
      };
    component.onClickVectorItem($event).subscribe(() => {
      expect(helperService.getSplitGeojsonData).toHaveBeenCalled();
      expect(component.addPrimitivePointsFromSource).toHaveBeenCalledWith(only_points, $event);
      expect(component.addDataSourceFromSource).toHaveBeenCalledWith(without_points, $event);
    });

    $event.item.checked = false;
    $event.item.dataSource = 'fake_dataSource_layer';
    $event.item.points = 'fake_point_primitive_colloection_layer';

    component.onClickVectorItem($event).subscribe(() => {
      expect(component.viewer.dataSources.remove).toHaveBeenCalledWith($event.item.dataSource);
      expect(component.viewer.scene.primitives.remove).toHaveBeenCalledWith($event.item.points);
    });
  }));


  it(`
    addDataSourceFromSource() should:
      1) placement item.dataSource to dataSource layer
      2) add this dataSource to viewer.dataSources (Data Sources Collection)
      3) flyTo dataSource if notFly equal false`, async(() => {

    spyOn(component, 'flyToLayer');

    let $event: { item: any, notFly?: boolean } =
      {
        item: {
          url: 'url_to_geojson',
          checked: true
        },
        notFly: false
      };

    let source = without_points;
    component.addDataSourceFromSource(source, $event).subscribe(() => {
      expect($event.item.dataSource).toBeDefined();
      expect(component.viewer.dataSources.indexOf($event.item.dataSource) !== -1).toBeTruthy();
      expect(component.flyToLayer).toHaveBeenCalledWith({ layer: $event.item.dataSource });
    });
  }));


  it(`
    addPrimitivePointsFromSource() should:
      1) placement item.points to pointCollection layer
      2) add all points from source as point primitives
    `, async(() => {

    spyOn(component, 'flyToLayer');

    let $event: { item: any, notFly?: boolean } =
      {
        item: {
          url: 'url_to_geojson',
          name: 'points',
          checked: true
        }
      };

    let source = only_points;


    component.addPrimitivePointsFromSource(source, $event);
    expect($event.item.points).toBeDefined();
    expect(component.viewer.scene.primitives.contains($event.item.points)).toBeTruthy();
    expect($event.item.points.length).toEqual(3);
    $event.item.points._pointPrimitives.forEach((point) => {
      expect(point.color).toEqual(Cesium.Color.CHARTREUSE);
    });
  }));

});


